import React  from "react";

const What=(state)=>{
     const {items} = state;
  const add = items.map=(item=>{
    return(
        <div key={item.id}>
{item.id}
{item.name}
{item.age}
        </div>
        )

}
  )       
  return(
    {add}
  )  
}
export default What;
